import React, { Component } from 'react';

class StallDisplay extends Component {
  render() {
    return (
      <div> 
          <div style={styles.container} >
            <h1>Stalls</h1>
          </div>
     </div>
    );
  }
}

export default StallDisplay;

const styles = [
    {
        container: {
            color: 'blue'
        }
    }
]
